package main

import (
	"fmt"
	"strings"
)

func main() {
	fmt.Println(solution(in))
}

func solution(data string) int {
	var diff = byte('a' - 'A')

	for {
		isDiff := false
		for i := range data {
			if i >= len(data)-1 {
				break
			}

			if data[i] == data[i+1]+diff || data[i] == data[i+1]-diff {
				data = strings.ReplaceAll(data, data[i:i+2], "")
				isDiff = true
			}

		}
		if !isDiff {
			return len(data)
		}
	}
}

